import { Container } from "@mui/system";
import React, { useState } from "react";
import LoginButton from "../utilities/LoginButton";
import styles from "./signUp.module.css";
import CompanyName from "../assets/Instagram.png";

const SignUp = () => {
  const [mobileEmail, setMobileEmail] = useState("");
  const [name, setName] = useState("");
  const [userName, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [mobilevalidation, setMobileval] = useState(false);
  const [nameValidation, setNameval] = useState(false);
  const [userNameValidation, setuserNameval] = useState(false);
  const [passwordValidation, setpasswordval] = useState(false);
  const[count,setCount]=useState(0)

  const countFun=()=>{setCount(prevCount=>prevCount+1);}

  const submitHandler = (e) => {
    e.preventDefault();
    let form = {
      mobileEmail: mobileEmail,
      name: name,
      userName: userName,
      password: password,
    };
    setMobileval()
    if (form.mobileEmail.length < 10) {
      setMobileval(true);
      console.log(mobilevalidation,form.mobileEmail)

      console.log("mobile/email  not valid");
    } else {
      setMobileval(false);
      console.log(mobilevalidation)

      console.log("hit")

    }
    if (form.name.length < 4) {
      setNameval(true);
      console.log("name not valid");
      console.log(mobilevalidation);
    } else {
      setNameval(false);
      console.log("hit")

    }
    if (form.userName.length < 10) {
      setuserNameval(true);
      console.log("username not valid");
    } else {
      setuserNameval(false);
      console.log("hit")

    }

    if (form.password.length < 8) {
      setpasswordval(true);
      console.log("password not valid");


    } else {
      setpasswordval(false);
      console.log("hit")
    }
    console.log(mobilevalidation,nameValidation,userNameValidation,passwordValidation);
     if (mobilevalidation || nameValidation || userNameValidation || passwordValidation) {
        console.log("form not valid");
        return;
      } else {
        setMobileEmail("");
        setName("");
        setUsername("");
        setPassword("");
        console.log(form);
        return
      }
  };

  return (
    <div>
        <p>{count}</p>
        <button onClick={countFun}>count</button>
      <Container
        maxWidth="sm"
        sx={{
          backgroundColor: "white",
          border: "groove",
          height: 550,
          width: 390,
          marginTop: 11,
        }}
      >
        <div className={styles.logocontainer}>
          <img
            className={styles.logo}
            src={CompanyName}
            alt="logo"
            height={80}
            width={200}
          />
        </div>
        <form onSubmit={submitHandler}>
          <input
            style={{borderColor: mobilevalidation ? 'red' : '#ced4da',
        }}
            onChange={(e) => {
              setMobileEmail(e.target.value);
              console.log(mobilevalidation);
            }}
            value={mobileEmail}
            className={styles.input}
            type="text"
            placeholder=" Mobile number or email address"
          />
          <br />
          <input
            style={{ borderColor: nameValidation ? "red" : "#ced4da" }}
            onChange={(e) => {
              setName(e.target.value);
              console.log(name);
            }}
            value={name}
            className={styles.input}
            type="text"
            placeholder=" Full Name"
          />
          <br />
          <input
            style={{ borderColor: userNameValidation ? "red" : "#ced4da" }}
            onChange={(e) => {
              setUsername(e.target.value);
              console.log(userName);
            }}
            value={userName}
            className={styles.input}
            type="text"
            placeholder=" Username"
          />
          <br />
          <input
            style={{ borderColor: passwordValidation ? "red" : "#ced4da" }}
            onChange={(e) => {
              setPassword(e.target.value);
              console.log(password);
            }}
            value={password}
            className={styles.input}
            type="password"
            placeholder=" Password"
          />

          <p className={styles.terms}>
            By signing up, you agree to our Terms, Privacy Policy and Cookies
            Policy.
          </p>

          <LoginButton className={styles.loginbutton} type="submit">
            Sign Up
          </LoginButton>
        </form>
        <p className={styles.signup}>
          Have an account
          <a className={styles.link} href="login">
            {" "}
            Log in
          </a>
        </p>
      </Container>
    </div>
  );
};

export default SignUp;
